import numpy as np

def poly_designmtx(inputs, features, degree):
    """
    This function creates the designmatrix for the basis function using a poylnomial model
    the degree can be specified up to degree 6
    :param inputs: the data inputs matrix
    :param features: the selected features will automatically determine the number of selected features (the dimension)
    :param degree: the specified degree
    :return: the designmatrix
    """
    dim = len(features)
    features1 = inputs[:, features[0]]
    features2 = inputs[:, features[1]]
    features3 = inputs[:, features[2]]
    if dim > 3:
        features4 = inputs[:, features[3]]
    if dim > 4:
        features5 = inputs[:, features[4]]
    if dim > 5:
        features6 = inputs[:, features[5]]
    if dim > 6:
        features7 = inputs[:, features[6]]
    if dim > 7:
        features8 = inputs[:, features[7]]
    if dim > 8:
        features9 = inputs[:, features[8]]
    if dim > 9:
        features10 = inputs[:, features[9]]
    if dim > 10:
        features11 = inputs[:, features[10]]

    if dim == 3:
        designmtx = expand_to_design_3f(features1, features2, features3, degree)

    elif dim == 4:
        designmtx = expand_to_design_4f(features1, features2, features3, features4, degree)

    elif dim == 5:
        designmtx = expand_to_design_5f(features1, features2, features3, features4, features5, degree)

    elif dim == 6:
        designmtx = expand_to_design_6f(features1, features2, features3, features4, features5, features6, degree)

    elif dim == 7:
        designmtx = expand_to_design_7f(features1, features2, features3, features4, features5, features6, features7, degree)

    elif dim == 8:
        designmtx = expand_to_design_8f(features1, features2, features3, features4, features5, features6, features7, features8,
                                        degree)

    elif dim == 9:
        designmtx = expand_to_design_9f(features1, features2, features3, features4, features5, features6, features7,
                                        features8, features9, degree)

    elif dim == 10:
        designmtx = expand_to_design_10f(features1, features2, features3, features4, features5, features6, features7,
                                        features8, features9, features10, degree)

    elif dim == 11:
        designmtx = expand_to_design_11f(features1, features2, features3, features4, features5, features6, features7,
                                         features8, features9, features10, features11, degree)

    return designmtx

